import React, { Component } from 'react'
import PropTypes from 'prop-types'

export default class Comments extends Component {
    static propTypes = {
        prop: PropTypes
    }

    render() {
        const keys = Object.keys(this.props.comment)
        return (
            <div>
                {console.log(keys)}
                {this.props.comment.map((c) => {
                    return {c}
                })}
            {/* {this.props.comment.map(c => {
              return <div>{c}</div>
            })} */}
           </div>
        )
    }
}
